import React from "react";

import "./Results.css";

export default function Results(props) {
    if (props.results) {
        return(
            <div className="Results text-left">
                <div className="word">
                    {props.results.word.toUpperCase()}
                </div>
            </div>
        );
    } else {
        return(
            <div className="Results text-left">
                <div className="word">
                    {props.defaultWord.toUpperCase()}
                </div>
            </div>
        );
    }
}
